import React, { Component } from 'react'
import {Div0,Logo} from './sty.js'
export default class index extends Component {
  render() {
    return (
      <Div0>
        <Logo>
          <img src='https://i.imgur.com/BJ21wvu.png'  height={56} width={87.5}></img>
        </Logo>
      </Div0>
    )
  }
}
